delete from  stkinfo where  exchid='1' and stkid in('121001','121002');
delete from  STKLIST WHERE REGID IN('0117212001','0117212000','0117252000','0117252001') AND STKID IN('121001','121002');
delete from   stklistextend where REGID IN('0117212001','0117212000','0117252000','0117252001') AND STKID IN('121001','121002');
delete from openorder where exchid='1' and contractnum between 'QH90000001' and 'QH90000010';
update openorder  a  set  a.occurtime=(select    substr(b.tradedate,0,8)||substr(a.occurtime,9,14)       from sysconfig b ) where exchid='1' and contractnum between 'QH90000001' and 'QH90000010';
update openorder  a  set  a.offertime=(select    substr(b.tradedate,0,8)||substr(a.offertime,9,14)       from sysconfig b ) where exchid='1' and contractnum between 'QH90000001' and 'QH90000010';
update openorder  a  set  a.ordertime=(select    substr(b.tradedate,0,8)||substr(a.ordertime,9,14)       from sysconfig b ) where exchid='1' and contractnum between 'QH90000001' and 'QH90000010';
